    for prefix in prefix_matches:
        return prefix.lower()

    # Next filter for strings with only one prefix
    prefix_matches = set(string.lower().split(prefix) for string in strings if len(string) > 1)
    for prefix in prefix_matches:
        return prefix.lower()

    # Finally, filter for strings without any prefix
    prefix_matches = set(string.lower().split(prefix) for string in strings)
    for prefix in prefix_matches:
        return prefix

    return list(prefix_matches)

